export const rightToc = [];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "instructions"
    }}>{`Instructions`}</h1>
    <p>{`This project requires `}<a parentName="p" {...{
        "href": "https://www.python.org/downloads/release/python-370/"
      }}>{`Python3`}</a>{` to run and operate.`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Clone the repo using the command: `}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`
$ git clone https://github.com/ai-cfia/face_mask.git
`}</code></pre>
      </li>
    </ul>
    <p>{`Under `}<strong parentName="p"><em parentName="strong">{`datase2`}</em></strong>{` folder, create sub-folder for every person of interest. Put at least 10~15 pictures of each person in their respective folder. The folders should be named after every person in the database. `}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p"><em parentName="strong">{`It is highly advised to use a virtual environment and install the packages rather than the global environment`}</em></strong></p>
    </blockquote>
    <ul>
      <li parentName="ul">{`To use a virtual environment on macOS and Linux type the command:`}<pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  python3 -m venv env
`}</code></pre></li>
      <li parentName="ul">{`Followed by:`}<pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  source env/bin/activate
`}</code></pre></li>
    </ul>
    <p>{`The `}<strong parentName="p"><em parentName="strong">{`requirements.txt`}</em></strong>{` file contains all the package dependencies required to run the program.`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Type the command:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  pip install -r requirements.txt
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Next you need to run:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  python3 extract_embeddings.py --dataset dataset2 --embeddings output/embeddings.pickle --detector face_detection_model --embedding-model openface_nn4.small2.v1.t7
`}</code></pre>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Followed by:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  python3 train_model.py --embeddings output/embeddings.pickle --recognizer output/recognizer.pickle --le output/le.pickle
`}</code></pre>
        <p parentName="li">{`  Now your embedding are created and trained and youre ready to start a live video demo of the project.
`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Simply type in the command:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`$  python3 detect_mask_video.py
`}</code></pre>
        <p parentName="li">{`  And your camera should be activated and a video feed with labels should be started.`}</p>
      </li>
    </ul>
    </MDXLayout>;
}

;
